from typing import Any, Dict


def merge_dicts(*dicts: Dict[str, Any]) -> Dict[str, Any]:
    """Merge multiple dictionaries, with later ones overriding earlier ones on key conflicts.

    Args:
        *dicts: Variable number of dictionaries to merge. None values are skipped.

    Returns:
        A new dictionary containing all key-value pairs from the inputs.

    Raises:
        TypeError: If any non-None argument is not a dictionary.
    """
    result: Dict[str, Any] = {}
    for d in dicts:
        if d is None:
            continue
        if not isinstance(d, dict):
            raise TypeError(f"Expected dict, got {type(d).__name__}")
        result.update(d)
    return result


# --- Test cases ---

def test_basic_merge():
    assert merge_dicts({"a": 1}, {"b": 2}) == {"a": 1, "b": 2}

def test_override():
    assert merge_dicts({"a": 1}, {"a": 2}) == {"a": 2}

def test_triple_merge():
    assert merge_dicts({"a": 1}, {"b": 2}, {"c": 3}) == {"a": 1, "b": 2, "c": 3}

def test_triple_override():
    assert merge_dicts({"a": 1}, {"a": 2}, {"a": 3}) == {"a": 3}

def test_empty_dicts():
    assert merge_dicts({}, {}) == {}

def test_single_dict():
    assert merge_dicts({"a": 1}) == {"a": 1}

def test_no_args():
    assert merge_dicts() == {}

def test_none_skipped():
    assert merge_dicts({"a": 1}, None, {"b": 2}) == {"a": 1, "b": 2}

def test_all_none():
    assert merge_dicts(None, None) == {}

def test_none_value_in_dict():
    assert merge_dicts({"a": None}, {"b": 2}) == {"a": None, "b": 2}

def test_none_overrides_value():
    assert merge_dicts({"a": 1}, {"a": None}) == {"a": None}

def test_nested_dicts():
    result = merge_dicts({"a": {"x": 1}}, {"a": {"y": 2}})
    assert result == {"a": {"y": 2}}  # shallow override, not deep merge

def test_mixed_value_types():
    assert merge_dicts({"a": 1, "b": "two", "c": [3]}) == {"a": 1, "b": "two", "c": [3]}

def test_invalid_arg_raises():
    try:
        merge_dicts({"a": 1}, "not a dict")
        assert False, "Should have raised TypeError"
    except TypeError as e:
        assert "Expected dict, got str" in str(e)

def test_invalid_int_raises():
    try:
        merge_dicts(42)
        assert False, "Should have raised TypeError"
    except TypeError as e:
        assert "Expected dict, got int" in str(e)

def test_does_not_mutate_inputs():
    a = {"x": 1}
    b = {"y": 2}
    result = merge_dicts(a, b)
    result["z"] = 3
    assert "z" not in a
    assert "z" not in b


